import React, { Component } from 'react';
import Piechart from './Piechart';
import Listtest from './listtest';
import Row from './row';
import './App.css';
class App extends Component {
  constructor(props) {
  super(props);
  this.state = {
    dataset1: ['A','B','C','D','E','A','B','C','D','E','A','B','C','D','E'],
    dataset2: ['A','BB','CC','DD','EE','A','BB','CC','DD','EE','A','BB','CC','DD','EE'],
    dataset3: ['AAA','BBBB','C','DD','EE','AAA','BBBB','C','DD','EE','AAA','BBBB','C','DD','EE'],
    cdata:['A','EE','CC','DD','A','EE','CC','DD','A','EE','CC','DD','A','EE','CC','DD'],
    myrect:[]
  }
};
  render() {
    return (
      <div className="App">
        <div style={{display: "inline-block"}}> 
        {
          this.state.cdata.map((d,i)=>(<p key={i}>{d}</p>))
        } 
        </div>
        <Row dataset="Dataset2" data={this.state.dataset1}/>
        <Row dataset="Dataset2" data={this.state.dataset2}/>
        <Row dataset="Dataset2" data={this.state.dataset3}/>
      </div>
    );
  }
}
export default App;




